// Buyer.js
import React, { useState, useEffect } from 'react';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import axios from 'axios';
import SearchBar from '../searchbar/searchBar'
import Navbar from '../navbar/navbar'; // Import Navbar component
import BannerSlider from '../Banners/BannerSlider';
import Homecategories from '../category/Homecatgory';
import ProductList from '../products/Productitem';

import { AuthProvider } from '../../provider/AuthProvider';
import Routing from '../../routes/Routes';
import Footer1 from '../Footer/Footer1';

import Login from '../navbar/Login';
import Signup from '../navbar/Signup';
import Profile from '../navbar/Profile';
import ForgotPassword from '../navbar/forgetpass';
import ResetPassword from '../navbar/resetpass';
import CartPage from '../navbar/addToCartPage';
import OrderHistoryPage from '../navbar/orderPage';


const Buyer = () => {
  const [selectedCategory, setSelectedCategory] = useState('Vegetables');
  const [cartCount,setCartCount]=useState(0);
    const [searchQuery, setSearchQuery] = useState('');
    const [isLoginOpen, setIsLoginOpen] = useState(false);

  const fetchCartCount =async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        throw new Error('No token found');
      }
      const response = await axios.get('http://localhost:5000/api/cart/count', {
        headers: { Authorization:` Bearer ${token}` }
      });
      if (response.data.success) {
        
       setCartCount(response.data.cartCount);
       
      }
    } catch (error) {
      console.error('Error fetching cart count:', error);
    }
  }


  const handleCategorySelect = (category) => {
    setSelectedCategory(category);
  };
  const handleSearch = (query) => {
    setSearchQuery(query);
  };
  
  return (
    <div>

<Router>
<AuthProvider>
      <Navbar setIsLoginOpen={setIsLoginOpen}  cartCount={cartCount} FetchCartCount={fetchCartCount}/>
      <Routes>

      <Route exact path="/login" element={isLoginOpen &&<Login setIsLoginOpen={setIsLoginOpen} />} />
        <Route exact path="/signup" element={isLoginOpen &&<Signup setIsLoginOpen={setIsLoginOpen}/>} />
        <Route exact path="/profile" element={isLoginOpen &&<Profile setIsLoginOpen={setIsLoginOpen} />} />
        <Route exact path="/forgot-password" element={isLoginOpen &&<ForgotPassword setIsLoginOpen={setIsLoginOpen}/>} />
        <Route exact path="/reset-password" element={isLoginOpen &&<ResetPassword setIsLoginOpen={setIsLoginOpen} />} />
        <Route exact path="/addtocart" element={<CartPage FetchCartCount={fetchCartCount}/>} />
        <Route exact path="/orders-history" element={<OrderHistoryPage />} />
      </Routes>

</AuthProvider>
       
    <SearchBar  onSearch={handleSearch} />
             
    {!searchQuery &&   <div className="slider-container">
      <BannerSlider />
      </div>}

    {!searchQuery &&   <Homecategories onCategorySelected={handleCategorySelect}/>}
      <AuthProvider>
      <ProductList fetchCartCount={fetchCartCount} category={selectedCategory}  searchQuery={searchQuery}/>
      </AuthProvider>
     <Footer1 />
     </Router>
     </div>
  );
};

export default Buyer;
